import React, { useEffect, useState } from "react";
import { toast } from "sonner";
import "./table.css";

const TableHeaderComponent = ({ url, keysToDisplay, displayedHeaders }) => {
    const [headers, setHeaders] = useState([]); // State to store fetched headers

    const handleHeadersFetched = (fetchedHeaders) => {
        setHeaders(fetchedHeaders); // Update state with fetched headers
    };

    return (
        <div>
            <DataFetcher apiUrl={url} onDataFetched={handleHeadersFetched} />
            {/* Render your table headers using the fetched headers */}
            <table>
                <thead>
                    <tr>
                        {headers.map((header, index) => (
                            <th key={index}>{displayedHeaders[header]}</th>
                        ))}
                    </tr>
                </thead>
            </table>
        </div>
    );
};

export default TableHeaderComponent;
